import Vue from 'vue';
import VueRouter from 'vue-router';

Vue.use(VueRouter);

const routes = [
    {
        path: '/page/indexhtml',
        name: 'Index',
        component: () => import('@/page/indexPage')
    }
];

const router = new VueRouter({
    mode: 'history',
    routes
});

export default router;
